import React from 'react';
import ReactDOM from 'react-dom/client';
import "./index.css";
import "../tailwind.config"




const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
    <nav className='flex h-10'>
      <ul>

        <li><i class="fa-solid fa-bars"></i></li>
        <li>Keeper</li>
        <li><i class="fa-solid fa-magnifying-glass"></i></li>
        <li><i class="fa-solid fa-rotate-right"></i></li>
        <li className='h-[10px]'><img src="https://images.pexels.com/photos/4195342/pexels-photo-4195342.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" alt="" /></li>
      </ul>
    </nav>
  </div>
);
